class Solution:
    def largest1BorderedSquare(self, grid: list[list[int]]) -> int:
        ones = []
        for i in range(0, len(grid)):
            for j in range(0, len(grid[i])):
                if grid[i][j] == 1:
                    ones.append([i, j])
        if not ones:
            return 0
        max_len = min(len(ones)//4, len(grid)-1)
        while max_len >= 0:
            if self.checkSquare(grid, ones, max_len):
                return (max_len+1)**2
            else:
                max_len -= 1

    def checkSquare(self, grid: list[list[int]], ones: list[list[int]], side: int):
        for origin in ones:
            if origin[0] < len(grid[0])-side and origin[1] < len(grid)-side:
                possible = True
                for i in range(1, side+1):
                    if grid[origin[0]+i][origin[1]] == 0 or grid[origin[0]][origin[1]+i] == 0:
                        possible = False
                        break
                if possible:
                    for i in range(side, 0, -1):
                        if grid[origin[0]+side][origin[1]-i] == 0 or grid[origin[0]-i][origin[1]+side] == 0:
                            possible = False
                            break
                    if possible:
                        return True
        return False


